Description:
"To support the ICRC humanitarian response plan in  health activities (part of YEM-2016-137)
 Stabilize the water supply for two million people;
 Provide alternative water solutions for 40,000 thousand people;
 Provide surgical and medical treatment for wounded/sick; 
 Provide first aid training to local medical staff;
 Rehabilitate 10 tertiary referral hospitals; and
 Help physical rehab centers assist 65,000 people with disabilities.
